INSERT INTO `tds_coremessageobject` VALUES ('Lookup.aspx','ClientSide',10538,'Proctor','Label.Instructions','<p>Enter the student‚Äôs full Student ID (SSID) and click [Submit SSID] to search for that student‚Äôs record. A record displays the student‚Äôs name, birth date, grade, and school/district information. Searches by partial SSID are not permitted.</p><br/><p>Note: This Student Lookup feature allows you to verify student information for login purposes only. It does not indicate whether a student is eligible to test. To verify student eligibility for a specific online assessment, please check TIDE.</p>',NULL,3210,NULL,'2012-05-03 19:17:37.860',NULL,NULL);
